import React from "react";
import "../styles/about.css";
import AboutImg from "../img/zaloguj sie1.png";
import Dates from "../components/Dates";
import Invitation from "../img/Invitation.pdf";

const About = () => {
	return (
		<section className="about section" id="about">
			<h2 className="section-title">Our Story</h2>
			<span className="section-subtitle">From the beginnings</span>

			<div className="about__container container grid">
				<img src={AboutImg} alt="my" className="about__img"></img>
				<div className="about__data">
					<Dates />
					<p className="about__description">Poznaliśmy się w liceum VLO w  Oliwie. 
					Połączyły nas rozmowy o sztuce. Pewnego razu Grześ zapytał się przez Messa czy 
					Julia nie chce iść z nim do kina. Poszli do Sopotu na Kamerdynera. Potem dłgo rozmawiali na molo. Tak zaczął się ich związek. 10.10.2018 Potem wiele razem podróżowali, zrobili Green Velo, mieli wiele przygód. Potem piękne zaręczyny na jachcie, 10.10.2021 a potem ślub. Potem dzieci, praca i starość.
					</p>

					<a download="" href={Invitation} className="button button--flex">Download Invitation</a>
				</div>
			</div>
		</section>
	)
}

export default About
